void Scanner::scanEmbeddedText(Scanner::Token &t)
{
    const char* &curPos = t.m_text.end;
    while(true) {
        const char *const prevPos = curPos;

{
        char yych;
        if ((m_end - curPos) < 2) YYFILL(2);
        yych = *curPos;
        switch (yych) {
        case 0x00:        goto yy553;
        case '\n':        goto yy550;
        case '\r':        goto yy548;
        case '#':        goto yy552;
        default:        goto yy555;
        }
yy548:
        ++curPos;
        switch ((yych = *curPos)) {
        case '\n':        goto yy558;
        default:        goto yy549;
        }
yy549:
        { continue; }
yy550:
        ++curPos;
yy551:
        { nextLine(curPos);
                   continue; }
yy552:
        yych = *++curPos;
        switch (yych) {
        case '>':        goto yy556;
        default:        goto yy549;
        }
yy553:
        ++curPos;
        { curPos = prevPos; syntaxError(curPos, "Premature end of embedded text"); }
yy555:
        yych = *++curPos;
        goto yy549;
yy556:
        ++curPos;
        { break; }
yy558:
        ++curPos;
        yych = *curPos;
        goto yy551;
}

    };
}

